import React from 'react';

export default function SVGFog({ className }) {
  return (
    <svg
      className={className}
      width="2000"
      height="2000"
      viewBox="0 0 2000 2000"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      style={{ filter: 'blur(60px)', width: '100vw', height: '100vh', display: 'block' }}
    >
      {/* High opacity, large ellipses for guaranteed visibility, now neon green */}
      <ellipse cx="0" cy="2000" rx="1200" ry="900" fill="#39ff14" fillOpacity="0.45" />
      <ellipse cx="0" cy="2000" rx="800" ry="600" fill="#39ff14" fillOpacity="0.28" />
      <ellipse cx="0" cy="2000" rx="400" ry="300" fill="#39ff14" fillOpacity="0.18" />
    </svg>
  );
}
